import React from "react"
import TreeList from "./components/TreeList"
import data from "./Storage"

export class App extends React.Component {
  state = data
  render() {
    return (
      <React.Fragment>
        <TreeList props={this.state.data} />
      </React.Fragment>
    )
  }
}

export default App
